import React from "react";
import MoviesCard from "../MoviesCard/MoviesCard";
import film1 from "../../images/film1.jpg";
import film2 from "../../images/film2.jpg"
import film3 from "../../images/film3.jpg";
import film4 from "../../images/film4.jpg";



function MoviesCardList(props) {
    return (
        <section className="movies-list">
            <MoviesCard film1={film1}></MoviesCard>
            <MoviesCard film1={film2}></MoviesCard>
            <MoviesCard film1={film3}></MoviesCard>
            <MoviesCard film1={film4}></MoviesCard>

        </section>


    );
}

export default MoviesCardList;
